    }

    render(){
    const { name, price } = this.props
       return (
            <div>
                <span>{name}</span> {` : `}   
                <span>{price}</span> {` : `}
                <button onClick={() => this.onDelete}>Delete</button>
            </div>
        )
   }
}

export default Instrument;
